import React from 'react';
import './ProjectCard.css';

function ProjectCard(props) {
  return (
    <div className="card">
      {props.projects.map((item) => (
        <>
          <h1>{item.title}</h1>
          <img src={item.imgURL} alt={item.title} />
          <p>hello world</p>
          <a className="btn btn-danger" src={item.deployed}>
            Deployed App
          </a>
          <a className="btn btn-success" src={item.github}>
            Github Repo
          </a>
        </>
      ))}
    </div>
  );
}
export default ProjectCard;
